import { SignedIn, SignedOut } from "@clerk/clerk-react";
import "./App.css";
import { AppProvider } from "./contexts/AppContext";
import Home from "./pages/Home";
import LoginPage from "./pages/Login";

function App() {
  return (
    <AppProvider>
      <SignedOut>
        <LoginPage />
      </SignedOut>
      <SignedIn>
        <Home />
      </SignedIn>
    </AppProvider>
  );
}

export default App;
